INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 1, 0.0, "2020/04/30 12:00:00", 0, "あたしだって\nやるときはやるよ！", "リン", 1, 0.0, 24001, 0.0, 24, 10040, "2030/12/17 14:59:59");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 1, 0.0, "2020/04/30 12:00:00", 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", "リン", 1, 0.0, 24002, 0.0, 24, 10040, "2030/12/17 14:59:59");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 1, 0.0, "2020/04/30 12:00:00", 2, "終わった終わった\n一人でもなんとか\nなるもんだね", "リン", 1, 0.0, 24003, 0.0, 24, 10040, "2030/12/17 14:59:59");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 2, 0.0, "2020/04/30 12:00:00", 3, "やったね！\nこれでようやく\nサボれるよ…", "リン", 2, 0.0, 24004, 0.0, 24, 10040, "2030/12/17 14:59:59");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 1, 0.0, "2020/04/30 12:00:00", 4, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", "リン", 1, 0.0, 24005, 0.0, 24, 10040, "2030/12/17 14:59:59");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 2, 0.0, "2020/04/30 12:00:00", 5, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", "リン", 2, 0.0, 24006, 0.0, 24, 10040, "2030/12/17 14:59:59");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 2, 0.0, "2020/04/30 12:00:00", 6, "あたしも意外と\nやるもんでしょ？", "リン", 2, 0.0, 24007, 0.0, 24, 10040, "2030/12/17 14:59:59");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 4, 0.0, "2020/04/30 12:00:00", 7, "疲れた…\nねずみの逃げ足\n速すぎるよ…", "リン", 4, 0.0, 24008, 0.0, 24, 10040, "2030/12/17 14:59:59");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 4, 0.0, "2020/04/30 12:00:00", 8, "このままじゃ\nまっひ～に\n叱られちゃうよ", "リン", 4, 0.0, 24009, 0.0, 24, 10040, "2030/12/17 14:59:59");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 4, 0.0, "2020/04/30 12:00:00", 9, "まじめに\nやったんだけどな…\n悔しいな～", "リン", 4, 0.0, 24010, 0.0, 24, 10040, "2030/12/17 14:59:59");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 4, 0.0, "2020/04/30 12:00:00", 10, "やられた…\nねずみって意外と\nてごわいね", "リン", 4, 0.0, 24011, 0.0, 24, 10040, "2030/12/17 14:59:59");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 4, 0.0, "2020/04/30 12:00:00", 11, "おのれ～\nあたしのチーズを\n盗みやがって～！", "リン", 4, 0.0, 24012, 0.0, 24, 10040, "2030/12/17 14:59:59");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (102601, 4, 0.0, "2020/04/30 12:00:00", 12, "疲れた…\nけど、次こそは\n守り抜くよ…", "リン", 1, 0.0, 24013, 1.81, 24, 10040, "2030/12/17 14:59:59");
